import React, { Component } from "react";

class NavMenu extends Component {
  state = {};

  render() {
    var visibility = "hide";

    if (this.props.menuVisibility) {
      visibility = "show";
    }
    return (
      <div
        style={{
          backgroundColor: "rgba(252, 186, 3, .8)",
          width: 450,
          height: "163vh",
          position: "absolute",
          right: 0,
          zIndex: 1,
        }}
      ></div>
    );
  }
}

export default NavMenu;
